import React from 'react';
import logo from './logo.svg';
import './App.css';

var db = require('mysql2-promise')();

db.configure({host :'localhost', user : 'root', password : 'Carlsberg27', database :'twitter'})

db.query('SELECT name,handle,text FROM celeb_tweets').spread(function (users) {
  console.log('Hello users', users);
});

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
